import React from 'react';
import { Grid, Divider } from 'semantic-ui-react';

const Homepage = () => {
	return (
		<div>
			<h1>Four Walls of Iron</h1>
			<Grid columns={2}>

					<Grid.Column>
						{'Strength'}
					</Grid.Column>
					<Grid.Column>
						{'Bodybuilding'}
					</Grid.Column>

			</Grid>
			<Divider vertical>Or</Divider>
		</div>
	)
}

export default Homepage;
